    "2013-03-14T19:29:31.869824",nt"name": "vernal-pool-complexes-central-valley-1989-1998-ds36",nt"isopen":
    false,nt"url": null,nt"notes": "This Arc/Info coverage is a polygon layer
    of vernal pool complexes greater than 40 acres in size for 29 counties throughout
    the greater Central Valley, and some north bay counties. These data were collected
    and vernal pool complexes were identified and mapped by Dr. Robert F. Holland in
    1995 and refined in a 1998 update. This layer does not contain delineations of individual
    vernal pools and is not intended for use for wetland delineations or regulatory
    use. For additional information on the vernal pools mapping projects see the report,
    Changes in Great Valley Vernal Pool Distribution from 1989 to 1997, June 1998, by
    Robert F. Holland, Ph.D. It is available online at: http://www.dfg.ca.gov/bdb/wetlands/vp_holland/report_index.htm
